import React, { Component } from "react";
import Navbar from "./Component/Navbar";
import Section from "./Component/Section";
let dummyText = "hello world part something";

export default class NavbarLinker extends Component {
  render() {
    return (
      <div className="NavBarLinker">
        <Navbar />
        <Section title="Home" subtitle={dummyText} dark={true} id="Home" />
        <Section title="About" subtitle={dummyText} dark={false} id="About" />
        <Section
          title="Professional Experience"
          subtitle={dummyText}
          dark={true}
          id="Professional Experience"
        />
        <Section
          title="Extracurriculars"
          subtitle={dummyText}
          dark={false}
          id="Extracurriculars"
        />
      </div>
    );
  }
}
